import React, { Component } from "react";
import { Card } from "react-bootstrap";

class Course extends Component {
  render() {
    const str = this.props.body;
    return (
      <div>
        <h3>{this.props.title}</h3>
        {str.replace(/^"(.*)"$/, "$1")}
      </div>
    );
  }
}

export default Course;
